import Head from "next/head";
import { getAllCategories } from "../content-api";

export async function getServerSideProps() {
  const data = await getAllCategories();

  return {
    props: data,
  };
}

export default function Index(props: { categories: [] }) {
  const { categories } = props;

  return (
    <>
      <Head>
        <link
          rel="icon"
          type="image/png"
          sizes="32x32"
          href="/favicon-32x32.png"
        />
        <link
          rel="icon"
          type="image/png"
          sizes="16x16"
          href="/favicon-16x16.png"
        />
        <link
          rel="apple-touch-icon"
          sizes="180x180"
          href="/apple-touch-icon.png"
        />
        <link rel="manifest" href="/site.webmanifest" />
        <meta name="theme-color" content="#ffffff" />

        <title>Projects</title>
      </Head>
      <div>
        <div>
          <div className="container mx-auto text-center">
            <h1 className="text-xl">Active personal and family projects</h1>
            <ul>
              {categories.map((category) => (
                <a href={`/project/${category.title}`}>
                  <li className="cursor-pointer hover:font-light">
                    {category.title}
                  </li>
                </a>
              ))}
            </ul>
          </div>
        </div>

      </div>
    </>
  );
}
